import React from "react";
import { Form } from "react-bootstrap";
import { BrowserRouter as Router, Redirect, Route } from 'react-router-dom';

import LoginComponent  from '../pages/login';
import {PrivateRoute} from '../_component/PrivateRoute'

import { pathList } from './Paths';
// const getList = () => {
//   return pathList.map( (compList, id) => {
//     return  <Route key={id} exact path={compList.path}  component={compList.name} /> 
//     })
// }


export const AppRoute = () => {
  let token = localStorage.getItem('accessToken');

  return (
    <Router>
      {
         pathList.map( (compList, id) => {
          <PrivateRoute path={compList.path}  component={compList.name}  exact   />
         } )
      }
     
      <Route path="/login" exact component={LoginComponent} /> 
      {/* <Redirect from="*" to="/" /> */}
    </Router>
  );
};
